import React from "react";
import "./RecommendedVideos.css";
import VideoCard from "./VideoCard";

function RecommendedVideos() {
  return (
    <div className="recommendedVideos">
      <h2>Recommended</h2>
      <div className="recommendedVideos_videos">
        <VideoCard
          title="Become a Web Developer in 10 minutes"
          views="2.3M Views"
          timestamp="3 days ago"
          channelImage="https://yt3.ggpht.com/a-/AOh14GidOBYRrLz8iVpEGTpAPOutnaKuuYNWYTXhZA=s68-c-k-c0x00ffffff-no-rj-mo"
          channel="Sonny Sangha"
          image="https://i.ytimg.com/an_webp/UaB_FtsdlYk/mqdefault_6s.webp?du=3000&sqp=COmc7f4F&rs=AOn4CLCq_uMmZ6HSGaOWpQOu30CBTv27Pw"
        />
      </div>
    </div>
  );
}

export default RecommendedVideos;
